import React from 'react';
import Table from 'react-bootstrap/Table';

function Stakers({ stakers }) {
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Address</th>
        </tr>
      </thead>
      <tbody>
        {stakers.map((staker, index) => (
          <tr key={staker}>
            <td>{index + 1}</td>
            <td>{staker}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
}

export default Stakers;
